import { render } from '@testing-library/react';
import React from 'react';
import {Button, Input} from 'semantic-ui-react';


function Login2(){
  return(
    <div>
      <Input/>
      <Button onClick={(e)=>{
        console.log(e)
        alert(e.target.value)}}>로그인</Button>
    </div>
  )
}

class Login extends React.Component{
  constructor(){
    super()
    this.state = {id:""}
  }

  render(){
    return(
      <div>
      <Input/>
      <Button value={this.state.id} onClick={(event)=>{
        alert(event.target.value)}}>Login</Button>
    </div>
    )
  }
}

function App() {
  return (
    <div className="App">
      <Button basic color='green' content='버튼' />
      <Login/>
    </div>
  );
}

export default App;
